import React from "react";
import "./App.css";
import Video from "./Video";

function App() {
  return (
    <div className="app">
      <center>
        <div className="app__videos">
          {/* pulled from firebase database */}

          <Video
            url="http://download1642.mediafire.com/54whkejck3hg/1gnwnkjetsmflqg/%D9%88%D8%A7%D9%84%D9%84%D9%87+%D8%AC%D8%AF%D9%88+%D8%B7%D9%84%D8%B9+%D9%85%D8%B9%D9%88+%D8%AD%D9%82+%F0%9F%98%82%F0%9F%98%82%F0%9F%98%82+%23tiktokarab.mp4"
            channel="Howieazy"
            description=" Why he gotta trick me like that #fyp #howieazy #comedy #foryou "
            song="Original Sound - Howieazy"
            likes={97223}
            messages={8811}
            shares={3298}
          />
          <Video
            url="http://download1642.mediafire.com/54whkejck3hg/1gnwnkjetsmflqg/%D9%88%D8%A7%D9%84%D9%84%D9%87+%D8%AC%D8%AF%D9%88+%D8%B7%D9%84%D8%B9+%D9%85%D8%B9%D9%88+%D8%AD%D9%82+%F0%9F%98%82%F0%9F%98%82%F0%9F%98%82+%23tiktokarab.mp4"
            channel="Leenhabbal"
            description=" مين متلي ما بيشعر بالوقت عالtiktok? #tiktokarab #arab #middleeastern"
            song="Come and Get Your Love"
            likes={123}
            messages={12121}
            shares={12121}
          />

          <Video
            url="https://streamable.com/e/lr33p1"
            channel="Amal_Tampa"
            description=" Our differences make us closer #fyp #beach #saudiarabia #french #friends #florida #tampa"
            song="Ride It - Regard"
            likes={2019}
            messages={196}
            shares={114}
          />
        </div>
      </center>
    </div>
  );
}

export default App;
